var faqChargee=function(e){if(document.getElementById("faq-search-block-search-field")){document.getElementById("faq-search-block-search-field").addEventListener("focus",function(){console.log("focusSearch");for(var e=document.querySelector(".faq-search-block").offsetTop-80,o=document.querySelectorAll("[data-sticky]"),t=0,c=0;c<o.length;c++)t+=o[c].offsetHeight;currentOffset=window.pageYOffset+t,currentOffset<e&&window.scrollTo({top:e,behavior:"smooth"})}),document.getElementById("faq-search-block-search-field").addEventListener("keyup",function(){console.log("faqUp");for(var e=document.querySelector("ul#faq").offsetTop,o=e-80,t=document.querySelectorAll("[data-sticky]"),c=0,f=0;f<t.length;f++)c+=t[f].offsetHeight;currentOffset=window.pageYOffset+c,currentOffset>e&&window.scrollTo({top:o,behavior:"smooth"})})}};